import React from "react";

import PictureCard from "./picture-card";

import "./picture-card.css";

const ImageRenderer = ({ index, left, top, key, photo }) => (
    <PictureCard
        key={key}
        margin={"2px"}
        index={index}
        photo={photo}
        left={left}
        top={top}
    />
);

export default ImageRenderer
